import React from 'react';

import { Jumbotron } from 'reactstrap';

const Home=()=>{

    return (
        <div>
            <Jumbotron>
                <h1 className="text-center my-7">Welcome</h1>
            </Jumbotron>
        </div>
    )
};

export default Home;
